const CalCalrorie = () => {
       return (
        <div className="flex py-20 space-x-20 justify-center ">
                <div className="flex w-80 h-80 rounded-full bg-white border-4 border-yellow-100 justify-center items-center font-bold text-3xl">
                    일별 칼로리
                </div>
                <div className="flex w-80 h-80 rounded-full bg-white border-4 border-pink-200 justify-center items-center font-bold text-3xl">
                    주별 칼로리
                </div>
                <div className="flex w-80 h-80 rounded-full bg-white border-4 border-blue-100 justify-center items-center font-bold text-3xl">
                    월별 칼로리
                </div>
        </div>
    ); 
}

export default CalCalrorie
